import React from "react";
import pokemons from "../data";
import Pokemons from "./Pokemon";

class Pokedex extends React.Component {
    render(){
      return(
        <div>
          {pokemons.map((pokemon) => <Pokemons key={pokemon.id} /> )}
        </div>
      )
    }
}

export default Pokedex;
